pragma solidity ^0.8.8;

import "@chainlink/contracts/src/v0.8/interfaces/AggregatorV3Interface.sol";

contract FundMe {

    uint256 minUsd = 50;

    function fund() public payable{
        require(msg.value >= minUsd, "Didn't enugh money"); // here 2nd arg is revert functions 
        //here require acts like a checker for send money, 
        // msg is a global obj
    }

    function getVersion() public view returns (uint256){
        AggregatorV3Interface price = AggregatorV3Interface(0xD4a33860578De61DBAbDc8BFdb98FD742fA7028e);
        return price.version();
    }

    // function withdraw(){

